import React , { useState } from 'react';


let currSecond = new Date();
currSecond = currSecond.getSeconds();

let rSecond = new Date();
rSecond = rSecond.getSeconds();

function App(){

  const [second , setsecond] = useState(currSecond);

  function GetTime(){
    setsecond(rSecond);
  }

  return(
    <>
      <h1>{second}</h1>
      <button onClick={GetTime}>Get Time</button>
    </>
  )
}

export default App;
